import React from "react";
import { Link, useParams, withRouter } from "react-router-dom";
//import { Redirect, Route } from "react-router-dom";
import { Redirect, useHistory } from "react-router-dom";

const AddGood = () => {
  const { firstname, lastname } = useParams();
  var flag = window.sessionStorage.getItem("isAuth");
  console.log("The AddGood flag has been modified to a " + flag);
  console.log("The AddGood flag TYPE : " + typeof flag);
  var decision;
  if (flag === "false") {
    decision = 0;
    console.log("The Decision (from Add Good) is : " + decision);
  } else {
    decision = 1;
    console.log("The Deicions (from add good) is: " + decision);
  }
  console.log(
    "Add Good local storage key: " + window.sessionStorage.getItem("isAuth")
  );
  console.log(
    "Add Good local storage value type is a : " +
      typeof window.sessionStorage.getItem("isAuth")
  );
  return (
    <div>
      {decision ? (
        <Redirect to={"/user/Michael/Wicks"} />
      ) : (
        <Redirect to={"/BadBoy"} />
      )}
      <h1>
        {" "}
        User: {firstname} {lastname}{" "}
      </h1>
      <p>AUTHENTICATED: THIS IS MAIN GOOD</p>
      {/*      <button>
        <Link to="/main">Go back.</Link>
</button> */}
    </div>
  );
};

export default withRouter(AddGood);
